import React, { useState, useEffect } from "react";
import { jsPDF } from "jspdf";
import "jspdf-autotable";
import axiosInstance from "../services/axiosInstance";

const GeneratePDFButton = ({ patient }) => {
  const [base64Image, setBase64Image] = useState("");

  useEffect(() => {
    const convertToBase64 = (file) => {
      return new Promise((resolve, reject) => {
        const reader = new FileReader();
        reader.readAsDataURL(file);
        reader.onload = () => resolve(reader.result);
        reader.onerror = (error) => reject(error);
      });
    };

    const fetchImageAsBase64 = async () => {
      try {
        const response = await import("../assets/placeholder2.jpg");
        const blob = await fetch(response.default).then((r) => r.blob());
        const base64String = await convertToBase64(blob);
        setBase64Image(`data:image/jpeg;base64,${base64String}`);
      } catch (error) {
        console.error("Error fetching image:", error);
        setBase64Image(
          "data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAUA" +
            "AAAFCAYAAACNbyblAAAAHElEQVQI12P4" +
            "//8/w38GIAXDIBKE0DHxgljNBAAO9TXL0Y4OHwAAAABJRU5ErkJggg=="
        );
      }
    };

    fetchImageAsBase64();
  }, []);

  const fetchImageData = async (url, type) => {
    let endpoint;
    switch (type) {
      case "explorations":
        endpoint = `/explorations/files/${url}`;
        break;
      case "ecgs":
        endpoint = `/ecgs/files/${url}`;
        break;
      case "biologies":
        endpoint = `/biologies/files/${url}`;
        break;
      default:
        return null;
    }

    try {
      const response = await axiosInstance.get(endpoint, {
        responseType: "arraybuffer",
      });
      const base64String = btoa(
        new Uint8Array(response.data).reduce(
          (data, byte) => data + String.fromCharCode(byte),
          ""
        )
      );
      const extension = url.split(".").pop().toLowerCase();
      const mimeType = `image/${extension === "jpg" ? "jpeg" : extension}`;
      return `data:${mimeType};base64,${base64String}`;
    } catch (error) {
      console.error("Error fetching image:", error);
      return (
        "data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAUA" +
        "AAAFCAYAAACNbyblAAAAHElEQVQI12P4" +
        "//8/w38GIAXDIBKE0DHxgljNBAAO9TXL0Y4OHwAAAABJRU5ErkJggg=="
      );
    }
  };

  const generatePDF = async () => {
    try {
      const doc = new jsPDF();

      // Define colors and styles
      const titleColor = [0, 77, 140];
      const sectionTitleColor = 100;
      const textColor = 0;
      const lineHeight = 8;
      const margin = 14;
      const sectionMargin = 10;

      // Adding a title
      doc.setFontSize(18);
      doc.setTextColor(...titleColor); // Spread the array to pass individual color components
      doc.text("Dossier Médical du Patient", margin, 22);
      doc.setFontSize(12);
      doc.setTextColor(textColor);

      // Basic information
      let currentY = 30;
      const addBasicInfo = (label, value) => {
        doc.text(`${label}: ${value}`, margin, currentY);
        currentY += lineHeight;
      };

      addBasicInfo("Nom", patient.nom);
      addBasicInfo("Prénom", patient.prenom);
      addBasicInfo("Âge", patient.age);
      addBasicInfo("Ville", patient.ville);
      addBasicInfo("Assurance", patient.assurance);
      addBasicInfo("Profession", patient.profession);
      addBasicInfo("Reference ID", patient.referenceID);

      // Add a separator line
      doc.setDrawColor(100);
      doc.line(margin, currentY + 4, 200, currentY + 4);
      currentY += sectionMargin;

      // Adding a section title
      doc.setFontSize(16);
      doc.setTextColor(sectionTitleColor);
      doc.text("Dossier Médical", margin, currentY);
      doc.setFontSize(12);
      doc.setTextColor(textColor);
      currentY += lineHeight;

      // Adding the medical dossier details
      const dossier = patient.medicalDossier || {}; // Default to empty object
      const textYStart = currentY + 10;

      const addTextWithWrap = (label, text, x, y) => {
        doc.setFillColor(230, 230, 230); // Light grey background
        doc.rect(x - 2, y - 2, 186, lineHeight * 2, "F"); // Background rectangle
        doc.setTextColor(...titleColor); // Spread the array to pass individual color components
        doc.text(`${label}:`, x, y);
        const splitText = doc.splitTextToSize(text || "N/A", 180);
        doc.setTextColor(textColor);
        doc.text(splitText, x + 6, y + lineHeight);
        return y + splitText.length * lineHeight + 10;
      };

      currentY = addTextWithWrap(
        "Hospitalisation",
        dossier.hospitalization,
        margin,
        currentY
      );
      currentY = addTextWithWrap(
        "Histoire de la Maladie",
        dossier.historyDisease,
        margin,
        currentY
      );
      currentY = addTextWithWrap(
        "Conclusion Principale",
        dossier.primaryConclusion,
        margin,
        currentY
      );
      currentY = addTextWithWrap(
        "Conclusion",
        dossier.conclusion,
        margin,
        currentY
      );

      // Add a separator line before the next section
      doc.setDrawColor(100);
      doc.line(margin, currentY + 4, 200, currentY + 4);
      currentY += sectionMargin;

      // Function to create tables
      const createTable = (title, data, columns, startY) => {
        if (data && data.length > 0) {
          doc.addPage();
          doc.text(title, 14, 20);
          doc.autoTable({
            startY: startY || 30,
            head: [columns],
            body: data,
            styles: { fontSize: 10, cellPadding: 3 },
            headStyles: {
              fillColor: [41, 128, 185],
              textColor: [255, 255, 255],
            },
            columnStyles: {
              0: { cellWidth: 10 },
              1: { cellWidth: 40 },
              2: { cellWidth: 40 },
              3: { cellWidth: 40 },
            },
            margin: { top: 10 },
            didDrawCell: (data) => {
              if (data.column.dataKey === 1 && data.cell.raw?.content) {
                doc.addImage(
                  data.cell.raw.content,
                  data.cell.raw.content
                    .split(";")[0]
                    .split("/")[1]
                    .toUpperCase(),
                  data.cell.x + 2,
                  data.cell.y + 2,
                  36,
                  18
                );
              }
            },
          });
        } else {
          // Handle case where data is empty
          doc.addPage();
          doc.text(title + ": No data available", 14, 20);
        }
      };

      const createTableMd = (title, data, columns, startY) => {
        if (data && data.length > 0) {
          doc.addPage();
          doc.text(title, 14, 20);
          doc.autoTable({
            startY: startY || 30,
            head: [columns],
            body: data,
            styles: { fontSize: 10, cellPadding: 3 },
            headStyles: {
              fillColor: [41, 128, 185],
              textColor: [255, 255, 255],
            },
            columnStyles: {
              0: { cellWidth: 10 },
              1: { cellWidth: 58 },
              2: { cellWidth: 58 },
              3: { cellWidth: 58 },
            },
            margin: { top: 10 },
            didDrawCell: (data) => {
              if (data.column.dataKey === 1 && data.cell.raw?.content) {
                doc.addImage(
                  data.cell.raw.content,
                  data.cell.raw.content
                    .split(";")[0]
                    .split("/")[1]
                    .toUpperCase(),
                  data.cell.x + 2,
                  data.cell.y + 2,
                  36,
                  18
                );
              }
            },
          });
        } else {
          // Handle case where data is empty
          doc.addPage();
          doc.text(title + ": No data available", 14, 20);
        }
      };

      const createTableSmall = (title, data, columns, startY) => {
        if (data && data.length > 0) {
          doc.addPage();
          doc.setFontSize(16);
          doc.text(title, 14, 20);
          doc.setFontSize(12);

          doc.autoTable({
            startY: startY || 30,
            head: [columns],
            body: data,
            styles: {
              fontSize: 10,
              cellPadding: 4,
              halign: "center", // Center text horizontally
              valign: "middle", // Center text vertically
            },
            headStyles: {
              fillColor: [41, 128, 185],
              textColor: [255, 255, 255],
              fontSize: 12, // Larger font size for headers
              fontStyle: "bold",
            },
            columnStyles: {
              0: { cellWidth: 15 },
              1: { cellWidth: 82 },
              2: { cellWidth: 82 },
            },
            margin: { top: 30 },
            theme: "striped", // Add striping for rows
            showHead: "everyPage", // Show table header on every page
            pageBreak: "auto", // Automatically break pages
            didDrawCell: (data) => {
              if (data.column.dataKey === 0) {
                doc.setTextColor(255, 0, 0); // Optional: Set text color for column 0
              } else {
                doc.setTextColor(0, 0, 0); // Set text color for other columns
              }
            },
          });
        }
      };

      // Data for antecedents
      const antecedentsData = (dossier.antecedents || []).map(
        (antecedent, index) => [
          index + 1,
          antecedent.personal || "N/A",
          antecedent.familial || "N/A",
          antecedent.cardiovascularRiskFactors || "N/A",
        ]
      );
      createTableMd("Antécédents", antecedentsData, [
        "#",
        "Personnel",
        "Familial",
        "Facteurs de Risque",
      ]);

      // Data for clinical exams
      const clinicalExamsData = (dossier.clinicalExams || []).map(
        (exam, index) => [
          index + 1,
          exam.pulmonary || "N/A",
          exam.abdominal || "N/A",
          exam.generalExam || "N/A",
          exam.functionalSigns || "N/A",
          exam.physicalSigns || "N/A",
        ]
      );
      createTable("Examens Cliniques", clinicalExamsData, [
        "#",
        "Pulmonaire",
        "Abdominal",
        "Examen Général",
        "Signes Fonctionnels",
        "Signes Physiques",
      ]);

      // Data for ECGs
      const ecgsData = await Promise.all(
        (dossier.ecgs || []).map(async (ecg, index) => {
          const imageUrl = await fetchImageData(ecg.imageUrl, "ecgs");
          return [
            index + 1,
            { content: imageUrl, type: "image" },
            ecg.conclusion || "N/A",
          ];
        })
      );

      // Adding ECGs table manually since autoTable does not support images in cells
      if (ecgsData.length > 0) {
        doc.addPage();
        doc.text("ECGs", 14, 20);
        let ecgYStart = 30;

        ecgsData.forEach((ecg, index) => {
          doc.text(`#${index + 1}`, 14, ecgYStart);

          // Add image
          doc.addImage(
            ecg[1].content,
            ecg[1].content.split(";")[0].split("/")[1].toUpperCase(),
            24,
            ecgYStart + 5,
            90,
            50
          );

          // Add text
          const textXStart = 40;
          const textYStart = ecgYStart + 60;
          const maxWidth = 150; // Adjust according to your layout
          const lineHeight = 10;

          // Split the text into lines that fit within the maxWidth
          const textLines = doc.splitTextToSize(ecg[2], maxWidth);
          doc.text(textLines, textXStart, textYStart, {
            maxWidth: maxWidth,
            lineHeight: lineHeight,
          });

          ecgYStart += 60 + (textLines.length - 1) * lineHeight;

          if (ecgYStart > 200 && index < ecgsData.length - 1) {
            doc.addPage();
            ecgYStart = 30;
          }
        });
      }

      // Data for diagnoses
      const diagnosesData = (dossier.diagnoses || []).map(
        (diagnosis, index) => [
          index + 1,
          diagnosis.diagnosis || "N/A",
          diagnosis.diagnosisDifferentiel || "N/A",
        ]
      );
      createTableSmall("Diagnoses", diagnosesData, [
        "#",
        "Diagnostic",
        "Différentiel",
      ]);

      // Data for explorations
      const explorationsData = await Promise.all(
        (dossier.explorations || []).map(async (exploration, index) => {
          const imageUrl = await fetchImageData(
            exploration.imageUrl,
            "explorations"
          );
          return [
            index + 1,
            exploration.type || "N/A",
            { content: imageUrl, type: "image" },
            exploration.conclusion || "N/A",
          ];
        })
      );

      if (explorationsData.length > 0) {
        doc.addPage();
        doc.text("Explorations", 14, 20);
        let explorationYStart = 30;

        explorationsData.forEach((exploration, index) => {
          const textY = explorationYStart + 80; // Adjust text position to be below the image
          const imageY = explorationYStart + 5;

          // Add exploration index
          doc.text(`#${index + 1}`, 14, explorationYStart);

          // Add text below the image
          doc.text(exploration[1], 24, explorationYStart);

          // Add image
          doc.addImage(
            exploration[2].content,
            exploration[2].content.split(";")[0].split("/")[1].toUpperCase(),
            24,
            imageY,
            70,
            70
          );

          // Add the text below the image
          const maxWidth = 170; // Adjust according to your page layout
          const lineHeight = 10;
          const textLines = doc.splitTextToSize(exploration[3], maxWidth);
          doc.text(textLines, 24, textY, { maxWidth, lineHeight });

          explorationYStart += 90 + (textLines.length - 1) * lineHeight;
          if (explorationYStart > 200 && index < explorationsData.length - 1) {
            doc.addPage();
            explorationYStart = 30;
          }
        });
      }

      const biologiesData = await Promise.all(
        (dossier.biologies || []).map(async (biology, index) => {
          let imageUrl = null;
          if (!biology.bilanImageUrl.endsWith(".pdf")) {
            imageUrl = await fetchImageData(biology.bilanImageUrl, "biologies");
          } else {
            imageUrl =
              "data:image/jpeg;base64,";
          }
          return [
            index + 1,
            { content: imageUrl, type: "image" },
            biology.conclusion || "N/A",
          ];
        })
      );

      if (biologiesData.some((data) => data !== null)) {
        doc.addPage();
        doc.text("Biologies", 14, 20);
        let biologyYStart = 30;

        biologiesData.forEach((biology, index) => {
          if (biology !== null) {
            doc.text(`#${index + 1}`, 14, biologyYStart);

            // Check if biology[1] and biology[1].content exist before adding the image
            if (biology[1] && biology[1].content) {
              doc.addImage(
                biology[1].content,
                biology[1].content.split(";")[0].split("/")[1].toUpperCase(),
                24,
                biologyYStart + 7,
                70,
                70
              );
            }

            // Define the maximum width for the text and the line height
            const textXStart = 24;
            const textYStart = biologyYStart + 85;
            const maxWidth = 170; // Adjust according to your page layout
            const lineHeight = 10;

            // Split the text into lines that fit within the maxWidth
            const textLines = doc.splitTextToSize(biology[2], maxWidth);
            doc.text(textLines, textXStart, textYStart, {
              maxWidth: maxWidth,
              lineHeight: lineHeight,
            });

            // Adjust biologyYStart to account for the height of the text
            biologyYStart += 95 + (textLines.length - 1) * lineHeight;

            // Check if biologyYStart exceeds the limit before adding a new page
            if (biologyYStart > 200 && index < biologiesData.length - 1) {
              doc.addPage();
              biologyYStart = 30;
            }
          }
        });
      }

      doc.save(`Dossier_Medical_${patient.nom}_${patient.prenom}.pdf`);
    } catch (error) {
      console.error("Error generating PDF:", error);
    }
  };

  return (
    <button
      onClick={generatePDF}
      className="bg-[#8f8df2] hover:bg-[#9f9df8] text-white px-4 py-2 rounded"
    >
      Générer PDF
    </button>
  );
};

export default GeneratePDFButton;
